export default function Navbar() {
  return (
    <div>
      <h3>FoundProtocol</h3>
      <div className="fixed top-10 right-10">
        <button class="rounded bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4">
          Contact Us
        </button>
      </div>
    </div>
  );
}
